			 *
			auth0Service.getUserData().then(tokenData => {
				dispatch(setUserDataAuth0(tokenData));
				dispatch(showMessage({ message: 'Logged in with Auth0' }));
			});
		}); */
	}, [dispatch]);

	return <FuseSplashScreen />;
}

export default Callback;
